@stevemessick I see that the Analysis Server doesn't give navigation data for the second `[String]` in this example.
Cc @bwilkerson, @scheglov.

```
/// See also:
///
///  * There is a great class you should really know about, [String]. If you don't
///    know about the [String] class, you've not been paying attention.
class A {}
```
<img width="951" alt="image" src="https://user-images.githubusercontent.com/4499789/168875763-4196af0d-ab85-4c5c-9113-6a377e9a9146.png">

I can reproduce this with:
```dart
///    know [String]
void f() {}
```

Maybe we consider a line with so many spaces a block of code and disable parsing comment references for it?
